import Header from '../Header'
import amazon from "../../assets/amazon.JPEG"

export default function MyBooks() {
    return (
        <>
            <Header />
            <h2>My Books Page</h2>
            <img src = {amazon} alt = 'amazon'/>
        </>
    )
}
